import React from "react";
import {
  Card,
  CardActions,
  CardContent,
  CardMedia,
  Button,
  Typography,
} from "@material-ui/core";

export default function Course() {
  return (
    <div>
      <Card>
        <CardMedia />
        <CardContent>
          <Typography></Typography>
          <Typography></Typography>
        </CardContent>
      </Card>
    </div>
  );
}
